  <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/js/bootstrap.min.js"

  <script>
    $.getJSON("data.json", function (data) {
      console.log(data);

      $(document).ready(function () {
        console.log("I am ready")
        for (var i = 0; i < 57; i++) {
          (function (index) {
            $('image#_' + (i + 1)).on('click', function () {
              alert('Godown NO ' + (index + 1) + ' \nCurrently ' + data[index].Customer +
                ' \narea of SQf ' + data[index].Sqft.i + '\n Current Pay' + data[index].Rent +
                '\n Per Sq F amount ' + (parseInt(data[index].Rent) / parseInt(data[index].Sqft.i))
              ); // index === the value that was passed
            });

            if(data[index].Customer == "Empty" ){
              $('image#_' + (i + 1)).css('opacity', 0)
            }
            if(data[index].Customer == "Under Construction" ){
              $('image#_' + (i + 1)).css('opacity', 0)
            }
         
            $('image#_' + (i + 1)).hover(
              function () {
                var $this = $(this);
                $this.data('bgcolor', $this.css('opacity')).css('opacity', 0.4);
              },
              function () {
                var $this = $(this);
                $this.css('opacity', $this.data('bgcolor'));
              }
            );
          })(i); // pass the value of i
        }
      });
    });
  </script>
